import java.lang.String
import java.lang.Runtime as Runtime
from jarray import array
import java.io.File
import os
import re
import javaos

osType = javaos._getOsType()

if osType == "nt":
	shellCmd = ["cmd", "/c"]
elif osType == "dos":
	shellCmd = ["command.com", "/c"]
elif osType == "posix":
        import java.lang
        # Handle OS Types not handled by Python (i.e. 'Windows Server 2012 R2')
        osName = java.lang.System.getProperty("os.name").lower()
        if osName.find("window") > -1:
            shellCmd = ["cmd", "/c"]
        else:
            shellCmd = ["sh", "-c"]

workdir = java.io.File(r"""<%=odiRef.getOption("JDE_DIRECTORY")%>""")
runube = [r"""runube -<%=odiRef.getOption("JDE_DELETE_PWD_FILE")%> <%=odiRef.getOption("JDE_PWD_FILE")%> <%=odiRef.getOption("JDE_ENVIRONMENT")%> <%=odiRef.getOption("JDE_ROLE")%> <%=odiRef.getOption("JDE_REPORT")%> <%=odiRef.getOption("JDE_VERSION")%> <%=odiRef.getOption("JDE_JOB_QUEUE")%> <%=odiRef.getOption("JDE_PROCESSING_MODE")%> <%=odiRef.getOption("JDE_HOLD_CODE")%> <%=odiRef.getOption("JDE_SAVE_CODE")%>"""]

cmd = shellCmd+runube

try:
	p = java.lang.Runtime.getRuntime().exec( cmd,None,workdir )

except :
	raise OdiKMException("ODIKM-JDEO-10000", "ODIKM-JDEO-10000: Failed to execute command: {0}", [cmd])

exitVal = p.waitFor();
if exitVal != 1:
	if  exitVal ==4:
		raise OdiKMException("ODIKM-JDEO-10001", "ODIKM-JDEO-10001: Failed to execute command: {0}, the authentication token has errors, the Runube error code is 4", [cmd])
	else:
		raise OdiKMException("ODIKM-JDEO-10002", "ODIKM-JDEO-10002: Failed to execute command ({0}), the Runube error code is {1}", [cmd, exitVal])
